import styled from "styled-components";

export const HomeWrapper = styled.div`
    overflow: hidden;
    width: 960px;
    margin: 0 auto;
   
`;

export const HomeLeft= styled.div`
    width: 625;
    float: left;
    background: blue;
`;

export const HomeRight = styled.div`
    width: 240px;
    float: right;
    background: green;
`;
